import "./App.css";

import About from "./components/About";
import Card from "./components/Card";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Products from "./components/Products";

function App() {

  return (
    <div>
     <Navbar></Navbar>
      <About></About>
      <Card></Card>
      <Products></Products>
      <Footer></Footer>
    </div>
  );
}

export default App;
